import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [rankedPrefs, setRankedPrefs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5000/api/users", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    })
      .then((res) => res.json())
      .then((users) => {
        const counts = {};
        users.forEach((user) => {
          if (user.preferences && user.preferences.length) {
            user.preferences.forEach((pref) => {
              counts[pref] = (counts[pref] || 0) + 1;
            });
          }
        });

        const ranked = Object.entries(counts)
          .map(([pref, count]) => ({ preference: pref, count }))
          .sort((a, b) => b.count - a.count);

        setRankedPrefs(ranked);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching users:", err);
        setLoading(false);
      });
  }, []);

  return (
    <div
      style={{
        marginLeft: 220,
        padding: 20,
        fontFamily: "'Poppins', sans-serif",
        background: "linear-gradient(180deg, #eef9f0 0%, #ffffff 100%)",
        minHeight: "100vh",
        color: "#2e4b2e",
        transition: "all 0.3s ease",
      }}
    >
      <h2
        style={{
          fontSize: "2rem",
          color: "#2b593f",
          marginBottom: "20px",
          textShadow: "1px 1px 2px rgba(43, 89, 63, 0.2)",
        }}
      >
        ðŸŒ¿ Most Common Preferences
      </h2>

      {loading ? (
        <p style={{ color: "#6b8061", fontStyle: "italic" }}>Loading...</p>
      ) : rankedPrefs.length === 0 ? (
        <p style={{ color: "#6b8061", fontStyle: "italic" }}>
          No preferences found.
        </p>
      ) : (
        <div
          style={{
            width: "fit-content",
            backgroundColor: "#ffffff",
            borderRadius: "16px",
            boxShadow: "0 6px 15px rgba(50, 100, 70, 0.15)",
            overflow: "hidden",
            transition: "transform 0.3s ease",
          }}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "translateY(-3px)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "translateY(0)")}
        >
          <table
            style={{
              width: "50%",
              borderCollapse: "collapse",
              borderRadius: "12px",
              overflow: "hidden",
              fontSize: "1rem",
              minWidth: "400px",
            }}
          >
            <thead>
              <tr style={{ backgroundColor: "#81c784", color: "#fff" }}>
                <th style={{ border: "none", padding: 12, textAlign: "left" }}>Rank</th>
                <th style={{ border: "none", padding: 12, textAlign: "left" }}>
                  Preference
                </th>
                <th style={{ border: "none", padding: 12, textAlign: "left" }}>Count</th>
              </tr>
            </thead>
            <tbody>
              {rankedPrefs.map((item, index) => (
                <tr
                  key={item.preference}
                  style={{
                    backgroundColor: index % 2 === 0 ? "#f3f8f3" : "#ffffff",
                    transition: "background-color 0.3s ease",
                  }}
                  onMouseEnter={(e) =>
                    (e.currentTarget.style.backgroundColor = "#e7f2e7")
                  }
                  onMouseLeave={(e) =>
                    (e.currentTarget.style.backgroundColor =
                      index % 2 === 0 ? "#f3f8f3" : "#ffffff")
                  }
                >
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: 10,
                      color: "#2f3e2f",
                      fontWeight: 600,
                    }}
                  >
                    <span
                      style={{
                        backgroundColor: "#a5d6a7",
                        color: "#2e7d32",
                        padding: "4px 10px",
                        borderRadius: "20px",
                        fontSize: "0.9rem",
                      }}
                    >
                      {index + 1}
                    </span>
                  </td>
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: 10,
                      color: "#345c34",
                    }}
                  >
                    {item.preference}
                  </td>
                  <td
                    style={{
                      borderBottom: "1px solid #d9e4d6",
                      padding: 10,
                      color: "#4b7d4b",
                      fontWeight: "500",
                    }}
                  >
                    {item.count}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
